import React from "react";
import { Button } from "react-bootstrap";

const Header =() => {
    return(
        <div style={{background: '#424242', height: '20px', fontSize: '12px', textAlign: 'center'}}>
            <button >Sign </button>
            <Button>My Account </Button>
            <Button>Order Status </Button>
            <Button>Help </Button> 
        </div>
    );
};

export default Header;
